import React, { Component } from "react";
import DataTable from "./DataTable";
import DataSearch from "./DataSearch";

export class Data extends Component {
  state = {
    data: []
  };
  getData = () => {
    axios
      .get("/search")
      .then(response => {
        this.setState({
          data: response
        });
      })
      .catch(err => {
        console.log(err);
      });
  };
  render() {
    return (
      <div>
        <DataSearch />
        <DataTable />
      </div>
    );
  }
}

export default Data;
